import React from 'react'
import { PieChart } from 'react-d3-components'

class DonutChart extends React.Component {
  render() {
    const data = [
      {
        label: 'Maharashtra',
        values: [
          { x: 'Pune', y: 25 },
          { x: 'Mumbai', y: 10 },
        ],
      },
      {
        label: 'Gujarat',
        values: [
          { x: 'Surat', y: 50 },
          { x: 'Rajkot', y: 20 },
        ],
      },
      {
        label: 'MP',
        values: [
          { x: 'Indore', y: 20 },
          { x: 'Bhopal', y: 5 },
          { x: 'Ujjain', y: 8 },
          { x: 'Sachi', y: 3 },
        ],
      },
    ]

    return (
      <PieChart
        data={data}
        width={500}
        height={500}
        margin={{ top: 10, bottom: 10, left: 100, right: 100 }}
        innerRadius={50}
        outerRadius={100}
        sectorBorderColor="white"
      />
    )
  }
}

export default DonutChart
